import React, {useEffect, useState} from "react";
function s(j){return JSON.stringify(j)}
function Team(props){

    
    let text=props.text;
    return (

        <div>

            <p className={props.className}>
            {s(props.data.teamId)} {props.data.teamName} <br/><br/><br/>
            </p>

        </div>

    )     
}
export default Team;
